import React, { Component } from "react";
import Layout from "../../components/Layout";
import Game from "../../components/Game";

class Theresume extends Component{
    
    render(){
        return(
            <Layout>
            
            <Head>
            <script src="../../components/MyGame/TemplateData/UnityProgress.js"></script>
            <script src="../../components/MyGameBuild/UnityLoader.js"></script>
            <script>
                UnityLoader.instantiate("unityContainer", "Build/Game.json");
            </script>
            </Head>
                <div className="container">
                    <div className="row d-flex justify-content-center">
                        <h1>The Resume Game</h1>
                        
                    </div>
                </div>                 
            </Layout>               
        )
    }
}

export default Theresume;
